	private static void regex() {
		String swissZIPs = "([1-468][0-9]|[57][0-7]|9[0-6])[0-9]{2}";
		String validZIP = "3063";
		String invalidZIP = "5802";
		
		StringMessageSpace messageSpace = new StringMessageSpace(swissZIPs);
		RankThenEncipher<String> rankThenEnc = new RankThenEncipher<String>(messageSpace);
		
		//Encrypt and decrypt
		String encZIP = rankThenEnc.encrypt(validZIP, key, tweak);
		System.out.println("Encrypt " + validZIP + ": " + encZIP);
		String decZIP = rankThenEnc.decrypt(encZIP, key, tweak);
		System.out.println("Decrypt " + encZIP + ": " + decZIP);
		
		//Outside message space
		try {
			rankThenEnc.encrypt(invalidZIP, key, tweak);
		}
		catch (OutsideMessageSpaceException ex) {
			System.out.println("Invalid zip: " + invalidZIP + ". " + ex.getMessage());
		}
		
		//Details
		System.out.println("\nDetails:");
		long t0 = System.nanoTime();
		messageSpace = new StringMessageSpace(swissZIPs);
		long t1 = System.nanoTime();
		rankThenEnc = new RankThenEncipher<String>(messageSpace);
		long t2 = System.nanoTime();
		BigInteger rank = messageSpace.rank(validZIP);
		long t3 = System.nanoTime();
		messageSpace.unrank(rank);
		long t4 = System.nanoTime();
		encZIP = rankThenEnc.encrypt(validZIP, key, tweak);
		long t5 = System.nanoTime();
		decZIP = rankThenEnc.decrypt(encZIP, key, tweak);
		long t6 = System.nanoTime();
		System.out.println("Finite       : " + messageSpace.isFinite());
		System.out.println("Order        : " + messageSpace.getOrder());
		System.out.println("Time init MS : " + (t1-t0)/1000 + " µs.");
		System.out.println("Time init RtE: " + (t2-t1)/1000 + " µs.");
		System.out.println("Time rank    : " + (t3-t2)/1000 + " µs.");
		System.out.println("Time unrank  : " + (t4-t3)/1000 + " µs.");
		System.out.println("Time encrypt : " + (t5-t4)/1000 + " µs.");
		System.out.println("Time decrypt : " + (t6-t5)/1000 + " µs.");
	}
	
